import Foundation
import XCTest

@testable import SystemStrings

// MARK: - CoreAudioKit Tests

@available(iOS 8.0, *)
final class CoreAudioKitStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜CoreAudioKit.preferredLocalization = nil
    }

