        XCTAssertEqual(String.Advertise｜CoreAudioKit, "\u{41}\u{64}\u{76}\u{65}\u{72}\u{74}\u{69}\u{73}\u{65}\u{20}\u{4D}\u{49}\u{44}\u{49}\u{20}\u{53}\u{65}\u{72}\u{76}\u{69}\u{63}\u{65}")
