        XCTAssertEqual(String.Connected_to_％＠｜CoreAudioKit, "\u{43}\u{6F}\u{6E}\u{6E}\u{65}\u{63}\u{74}\u{65}\u{64}\u{20}\u{74}\u{6F}\u{20}\u{25}\u{40}\u{2E}\u{20}\u{41}\u{64}\u{76}\u{65}\u{72}\u{74}\u{69}\u{73}\u{69}\u{6E}\u{67}\u{20}\u{64}\u{69}\u{73}\u{61}\u{62}\u{6C}\u{65}\u{64}\u{2E}")
